export enum HairElement {
    BehindHead, BehindEars, CoveringEars
}

class HairItem {

    id: HairType;
    name: string;
    frontSvg: string|HairSource;
    inFrontOfEars: boolean;
    backSvg?: string;

    constructor(id: HairType, name: string, frontSvg: string|HairSource, inFrontOfEars: boolean = false, backSvg?: string) {
        this.id = id;
        this.name = name;
        this.frontSvg = frontSvg;
        this.inFrontOfEars = inFrontOfEars;
        this.backSvg = backSvg;
    }
}


class HairCatalog {

    private static _instance: HairCatalog;

    items = [
        new HairItem(HairType.Bald, "Bald", ""),
        new HairItem(HairType.BowlCutHair, "Bowl Cut", BowlCutHair),
        new HairItem(HairType.StylishHair, "Stylish Short", MaleStylishShortHairFront, false, MaleStylishShortHairBack),
        new HairItem(HairType.SidePart, "Side Part", SidePart),
        new HairItem(HairType.TousledSidePart, "Tousled Side Part", SidePartNew),
        new HairItem(HairType.ShavedSides, "ShavedSides", ShavedSides),
        new HairItem(HairType.ShortAfro, "Short Curly", ShortAfro),
        new HairItem(HairType.VeryShortAfro, "Very Short Curly", VeryShortAfro),
        new HairItem(HairType.Balding, "Balding", BaldingHair),
        new HairItem(HairType.Receding, "Receding", RecedingHair, false),
        new HairItem(HairType.Mature, "Mature", MatureHair, false),
        new HairItem(HairType.DeLeve, "The \"de Leve\"-Style Shave", DeLeveHair),
        new HairItem(HairType.CentrePart, "Centre Part", CentrePart),
        new HairItem(HairType.CornRows, "Corn Rows", CornRows),
        new HairItem(HairType.MediumMaleCenterPart, "Medium Length Center Part", MediumMaleCenterPartFront, true, MediumMaleCenterPartBack),
        new HairItem(HairType.PulledBackPonyTail, "Pulled Back Pony Tail", PulledBackPonyTailFront, false, PulledBackPonyTailBack),
//        new HairItem(HairType.LongHair1, "Long Curly Hair", LongHair1Front, true, LongHair1Back),
        new HairItem(HairType.MediumLengthFemaleSidePart, "Medium Length Side Part", MediumLengthSidePart1Front, false, MediumLengthSidePart1Back),
        new HairItem(HairType.UpsweptWithProduct, "Upswept with Product", UpsweptWithProduct, false),
        new HairItem(HairType.SidePartSweptBack, "Side Part, Swept Back", SidePartSweptBack, false),
        new HairItem(HairType.PinnedUpHairWithPart, "Pinned Up Hair with Part", PinnedUpHairWithPartFront, true, PinnedUpHairWithPartBack),
        new HairItem(HairType.MediumLengthFemaleStraight, "Medium Length Straight", MediumLengthFemaleStraight, false),
        new HairItem(HairType.ChinLengthCombBack, "Chin Length Straight Comb Back", ChinLengthCombBackFront, false, ChinLengthCombBackBack),
        new HairItem(HairType.ShortTeasedOverEyeStyle, "Short, Teased, Over-Eye", ShortTeasedOverEyeStyleFront, false, ShortTeasedOverEyeStyleBack),
        new HairItem(HairType.FeminineDreadStyle, "Feminine Dread Style", FeminineDreadStyleFront, true, FeminineDreadStyleBack),
        new HairItem(HairType.ShoulderLengthMostlyStraight, "Shoulder Length Mostly Straight", ShoulderLengthMostlyStraightFront, true, ShoulderLengthMostlyStraightBack),
        new HairItem(HairType.ChinLengthBob, "Chin-Length Bob", ChinLengthBob, true),
        new HairItem(HairType.StraightCombedBackShort, "Straight, Combed-Back, Short", StraightCombBackShort, false),
        new HairItem(HairType.StraightCombedBackMedium, "Straight, Combed-Back, Medium", StraightCombedBackMedium, true),
        new HairItem(HairType.RomulanPeakedHair, "Peaked Short Hair", RomulanPeakedShortHair, false),
        new HairItem(HairType.ShoulderLengthBob, "Shoulder Length Bob", JanewayBobFront, true, JanewayBobBack),
        new HairItem(HairType.KlingonHair1, "Klingon Hair 1", KlingonHair.Hair1.Front, true, KlingonHair.Hair1.Back),
        new HairItem(HairType.KlingonHair2, "Klingon Hair 2", KlingonHair.Hair2.Front, true, KlingonHair.Hair2.Back),
        new HairItem(HairType.KlingonHair3, "Klingon Hair 3", KlingonHair.Hair3.Front, true, KlingonHair.Hair3.Back),
        new HairItem(HairType.HighForeheadEfrosianStyle, "Efrosian-style Mane", EfrosianStyleFront, true, EfrosianStyleBack),
    ];

    public static get instance() {
        if (HairCatalog._instance == null) {
            HairCatalog._instance = new HairCatalog();
        }
        return HairCatalog._instance;
    }

    getDefinitions(hairType: HairType, token: Token) {
        if (hairType === HairType.CornRows) {
            return CornRowsGradientDefinition.replace(/#383838/g, token.hairColor);
        } else {
            return "";
        }
    }

    getHair(token: Token, element: HairElement) {
        let hair = this.items.filter(i => i.id === token.hairType)[0];
        let front = (typeof hair.frontSvg === "string") ? hair.frontSvg as string : (hair.frontSvg as HairSource).front
        let back = (typeof hair.frontSvg === "string") ? hair.backSvg : (hair.frontSvg as HairSource).back;

        if (token.extras.indexOf(ExtraType.SecurityHelmet) >= 0 || token.extras.indexOf(ExtraType.VulcanHeaddress) >= 0) {
            return "";
        } else if (element === HairElement.BehindEars && !hair.inFrontOfEars) {
            return front.replace(/#383838/g, token.hairColor);
        } else if (element === HairElement.CoveringEars && hair.inFrontOfEars) {
            return front.replace(/#383838/g, token.hairColor);
        } else if (element === HairElement.BehindHead && back) {
            return back.replace(/#383838/g, token.hairColor);
        } else {
            return "";
        }
    }

    getSwatches(token: Token) {
        let hairTypes = SpeciesRestrictions.getHairTypes(token.species);
        return this.items
            .filter(i => hairTypes.indexOf(i.id) >= 0)
            .map(i => new Swatch(i.id, i.name, (token) => HairCatalog.decorateSwatch(i, token), makeKey("HairType.", HairType[i.id])));
    }

    private static decorateSwatch(hair: HairItem, token: Token) {
        let front = (typeof hair.frontSvg === "string") ? hair.frontSvg as string : (hair.frontSvg as HairSource).front
        let back = (typeof hair.frontSvg === "string") ? hair.backSvg : (hair.frontSvg as HairSource).back;
        let result = `<svg viewBox="0 0 280 280" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="hairClipPath` + hair.id + `">
                        <circle cx="140" cy="140" r="140" fill="#ffffff" />
                    </clipPath>`
                + this.instance.getDefinitions(hair.id, token)
                + `</defs>
                <g clip-path="url(#hairClipPath` + hair.id + `">
                    <g transform="translate(-130, 10)">`
                        + (back?.replace(/#383838/g, token.hairColor) ?? "")
                        + SimpleNeck.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor)
                        + ReferenceHead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor)
                        + front.replace(/#383838/g, token.hairColor)
                +  `</g>
                </g>
            </svg>`;
        return result;
    }
}

export default HairCatalog;